import base64
import zlib
import gzip
import lzma
import bz2
import binascii
from PIL import Image
from io import BytesIO

# Your encoded string (replace this with your actual encoded string)
encoded_string = """"""

def show_image(image_data):
    image = Image.open(BytesIO(image_data))
    image.show()

def test_base64(encoded_string):
    try:
        decoded_data = base64.b64decode(encoded_string)
        show_image(decoded_data)
        print("Base64 format worked!")
    except Exception as e:
        print(f"Base64 decoding failed: {e}")

def test_gzip(encoded_string):
    try:
        decoded_data = base64.b64decode(encoded_string)
        image_data = gzip.decompress(decoded_data)
        show_image(image_data)
        print("Gzip format worked!")
    except Exception as e:
        print(f"Gzip decoding failed: {e}")

def test_zlib(encoded_string):
    try:
        decoded_data = base64.b64decode(encoded_string)
        image_data = zlib.decompress(decoded_data)
        show_image(image_data)
        print("Zlib format worked!")
    except Exception as e:
        print(f"Zlib decoding failed: {e}")

def test_lzma(encoded_string):
    try:
        decoded_data = base64.b64decode(encoded_string)
        image_data = lzma.decompress(decoded_data)
        show_image(image_data)
        print("LZMA format worked!")
    except Exception as e:
        print(f"LZMA decoding failed: {e}")

def test_bzip2(encoded_string):
    try:
        decoded_data = base64.b64decode(encoded_string)
        image_data = bz2.decompress(decoded_data)
        show_image(image_data)
        print("Bzip2 format worked!")
    except Exception as e:
        print(f"Bzip2 decoding failed: {e}")

def test_hex(encoded_string):
    try:
        decoded_data = binascii.unhexlify(encoded_string)
        show_image(decoded_data)
        print("Hexadecimal format worked!")
    except Exception as e:
        print(f"Hexadecimal decoding failed: {e}")

def main():
    print("Testing Base64...")
    test_base64(encoded_string)
    
    print("\nTesting Gzip...")
    test_gzip(encoded_string)
    
    print("\nTesting Zlib...")
    test_zlib(encoded_string)
    
    print("\nTesting LZMA...")
    test_lzma(encoded_string)
    
    print("\nTesting Bzip2...")
    test_bzip2(encoded_string)
    
    print("\nTesting Hexadecimal...")
    test_hex(encoded_string)

if __name__ == "__main__":
    main()


